Marco comes over to pick up his sister's TV that she purchased. The woman who lives in the house takes one look at Marco and wants him to stick around for awhile. He feebly tries to fend her off, but one look at his chiseled body and youthful good looks, and she is ready to pounce. The TV moving can wait while she gets to know him a lot better.
